import React from "react";
import Box from '@mui/material/Box';
import zIndex from "@mui/material/styles/zIndex";

function Signin(){

    return(

        <Box
      sx={{
        width: 850,
        height: 400,
        position:'relative',
        left:400,
        top:250,
        display:'flex',
        flexDirection:'row',
        border:'2px solid red'
         }}>
             <Box sx={{
                    width:'60%',
                    height:'70%',
                    border:'1px solid green',
                    position:'relative',
                    top:50,
                    zIndex:0,
                    background:'#F5F5F5'



             }}>

             </Box>

             <Box sx={{
                 width:'70%',
                 height:'100%',
                 border:"1px solid blue",
                 position:'relative',
                 zIndex:2,
                 background:'#FFFFFF'





             }}>

             </Box>

        </Box>
    )

}
export default Signin
